import React from 'react';
import logo from '../images/logo.svg';
import '../styles/App.css';

function App() {
  return (
    <div className="App">
      <div class="header">
        <div class="wrap">
            <a href="https://www.sitehawk.com/" target="_blank"><img src="../public/logo.png" CssClass="logo" /></a>
        </div>
      </div>
    </div>
  );
}

export default App;
